content='Man kann Harnwegsinfektionen vorbeugen, indem man ausreichend trinkt. So werden Bakterien und andere Stoffe aus Nieren und Blase gespült. Regelmäßiges Wasserlassen hilft auch, damit sich keine Bakterien stark vermehren. Es ist wichtig, sich auf der Toilette Zeit zu lassen und die Blase komplett zu entleeren, ohne zu pressen. 

Außerdem sollte man immer von vorne nach hinten reinigen, um Bakterien fernzuhalten. Entspannen beim Wasserlassen hilft, die Blase besser zu entleeren. Nach dem Geschlechtsverkehr ist es gut, den Urin anzusäuern, um Infekten vorzubeugen. Auch das Verwenden von Kondomen kann helfen. 

